Verenigde Staten
Drama / Mystery
101 minuten

geregisseerd door Andrew Jarecki
met Kirsten Dunst, Ryan Gosling en Frank Langella

Jaren 80, New York. Een rijke jongen, telg van een magnaat in onroerend goed, wordt verliefd op een meisje aan de verkeerde kant van de stad. Ze krijgen een affaire, maar vervolgens verdwijnt het meisje. Een detective doet onderzoek naar de zaak, die heel goed de ondergang kan betekenen voor het imperium in onroerend goed.

